import React, { Component } from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation';
import FaceRecognition from './components/FaceRecognition/FaceRecognition';
import Logo from './components/Logo/Logo';
import Rank from './components/Rank/Rank';
import ParticlesBg from 'particles-bg'
import ImageLinkForm from './components/ImageLinkForm/ImageLinkForm';
// import Clarifai from 'clarifai';

// const app = new Clarifai.App({
//   apiKey: '851885a104204a2191f730b890d7e6bf'
// });
const returnClarifaiRequestOptions = (imageUrl) =>{
  const PAT = '851885a104204a2191f730b890d7e6bf';
  const USER_ID = 'nzxs15syr1vg';       
  const APP_ID = 'Myfirstapplication';
  const MODEL_ID = 'face-detection';    
  const IMAGE_URL = imageUrl;
  const raw = JSON.stringify({
    "user_app_id": {
        "user_id": USER_ID,
        "app_id": APP_ID
    },
    "inputs": [
        {
            "data": {
                "image": {
                    "url": IMAGE_URL
                }
            }
        }
    ]
  });
  const requestOptions = {
    method: 'POST',
    headers: {
        'Accept': 'application/json',
        'Authorization': 'Key ' + PAT
    },
    body: raw
  };
  return requestOptions
}

      // NOTE: MODEL_VERSION_ID is optional, you can also call prediction with the MODEL_ID only
      // https://api.clarifai.com/v2/models/{YOUR_MODEL_ID}/outputs
      // this will default to the latest version_id

class App extends Component {
  constructor(){
    super();
    this.state = {
      input: '',
      imageUrl:''
    }
  }
  onInputChange = (event) => {
    this.setState({input: event.target.value});
  }
  onButtonSubmit = () => {
    this.setState({imageUrl: this.state.input});    
    // app.models.predict('face-detection', this.state.input)
    fetch("https://api.clarifai.com/v2/models/" + 'face-detection' + "/outputs", returnClarifaiRequestOptions(this.state.input))
    .then(response => response.json())
    .then(
          function(response) {
            console.log(response.outputs[0].data.regions[0].regions_info.boudingbox);
          },
          function(err){

          }
      );
  }     
  render(){
    return (
      <div className="App">
        <ParticlesBg type="circle" bg={{position: "fixed", zIndex: -1, top: 0, left: 0, right: 0, bottom: 0}} />
        <Navigation />  
        <Logo />   
        <Rank /> 
        <ImageLinkForm 
          onInputChange={this.onInputChange}
          onButtonSubmit={this.onButtonSubmit}/>
        <FaceRecognition imageUrl={this.state.imageUrl} />
      </div>
    );
  }
}

export default App;
